import React from 'react';
import './Input.css';

export default class Input extends React.Component {
    static defaultProps = {
        name: '',
        id: '',
        type: '',
        placeholder: 'PLACEHOLDER'
    }

    render() {
        const { name, id, type, placeholder } = this.props;
        return (
            <input className='CommonInput' 
                    name={name} 
                    id={id}
                    type={type}
                    placeholder={placeholder} />
        )
    }
}
